import React from 'react';
import './App.css';

import Navbar from './components/Navbar';
import Hero from './components/Hero';
import TravelCarousel from './components/TravelCarousel';

function App() {
  return (
    <div>
      <Navbar></Navbar>
      <Hero></Hero>
      <TravelCarousel></TravelCarousel>
    </div>
  );
}

export default App;
